import React from 'react';
import { Map, Marker, Popup, TileLayer } from 'react-leaflet'

function handleClick() {
	console.log("Hei");
}

const LatLongMap = ({cx, cy, z, x, y}) => (
  <Map center={[cx, cy]} zoom={z}>
    <TileLayer
      url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      attribution="&copy; <a href=&quot;http://osm.org/copyright&quot;>OpenStreetMap</a> contributors"
    />
    <Marker position={[x, y]}>
      <Popup>A pretty CSS3 popup.<br />Easily customizable.</Popup>
    </Marker>
  </Map>
)

const LatLongList = ({latLongs}) => (
    <table>
		<tbody>
			{
				latLongs.map(latLong => (
					<tr key={latLong.latitude + "," + latLong.longitude}>
						<td onClick={handleClick}>{latLong.latitude + ", " + latLong.longitude}</td>
					</tr>))
			}
		</tbody>
    </table>
  )

const LatLongsComponent = ({latLongs}) => (
    <table>
		<tbody>
			<tr>
				<td><LatLongList latLongs={latLongs}/></td>
				<td><LatLongMap cx={0} cy={0} z={13} x={0} y={0}/></td>
			</tr>
			}
		</tbody>
    </table>
  )


export default LatLongsComponent;
